import axios from 'axios'
import properties from 'properties'
import React, { useEffect, useState } from 'react'
import Advices from '../Advices'
import CommerceProperty from '../CommerceProperty'
import MallProperties from '../MallProperties'
import { PostSection } from '../PostSection'
import PublicProperties from '../PublicProperties'
import { Slider } from '../Slider'


    const HomeProperties = () => {
        const [fetchProperties, setFetchProperties] = useState();


        useEffect(() => {
           getData();

        }, [])

       async function getData() {
           const propertiesResult = await axios.get(properties.properties_list_url);
           console.log(propertiesResult);
           setFetchProperties(propertiesResult.data.data);
       }

    return (

        <div className="container">
            <PublicProperties title="We've got properties for everyone" />
            <CommerceProperty title="we've got Commercial properties" />
            <MallProperties title="We've got  Malls properties " />
            <Advices />
            <PostSection title="  Post your Property for Free List it on Propnex and get genuine leads" />



         {
             fetchProperties.map((slide)=>{
                 return(

                    <Slider 
                    images={slide.property_images}

                    /> 

                 )
             })

           }  
        </div>
    )
}

export default HomeProperties
